import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import '../node_modules/bootstrap/dist/css/bootstrap.css';
import * as serviceWorker from './serviceWorker';

const routing = (
<Router>
<div className="App">
  <div className="App-header">
  <Navbar  fixed="top" bg="light" expand="md" >
    <Navbar.Brand href="home" className="title-nav">El Quijote</Navbar.Brand>
    <Navbar.Toggle aria-controls="basic-navbar-nav" />
    <Navbar.Collapse id="basic-navbar-nav">
      <Nav className="mr-auto ">
        <Nav.Link href="home">Inicio</Nav.Link>
        <Nav.Link href="Galeria">Galeria</Nav.Link>
        <Nav.Link href="Paquetes">Paquetes</Nav.Link>
        <Nav.Link href="Contacto">Contacto</Nav.Link>
        <Nav.Link href="Acerca">Acerca de</Nav.Link>
      </Nav>
    </Navbar.Collapse>
  </Navbar>
  </div>
  <Switch>
  <Route path="/home" component={Home_page}/>
  <Route path="/Galeria" component={Galeria_page}/>
  </Switch>
</div>
</Router>
)


ReactDOM.render(<App />, document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: http://bit.ly/CRA-PWA
serviceWorker.unregister();
